import articleContent from "./ArticleContent";
function Article({ match }) {


    const article = articleContent.find(article => article.name)

    if (!article)
        return <h1>{article} doesnot exist</h1>

    return (
        <>
            {article.map((content, key) => {
                <>
                    <h1>{content.name}</h1>
                    <h1>{content.description.map((describtion, key) => {
                        <p key={key}>{describtion}</p>
                    })}</h1>
                </>
            })}
        </>
    )

}

export default Article;
